    background: white;
    height: 100%;
    padding: 1rem;
    li {
      flex: 1 0 auto;
      transition: all 0.3s;
      display: flex;
      justify-content: center;
      align-items: center;
      cursor: pointer;
      &:hover {
        background-color: rgb(188, 30, 135);
        color: white;
        border-radius: 10px;
      }
    }
  }
}
.subList-wrapper {
  display: flex;
  flex-direction: column;
  font-size: 1.5rem;
  text-align: left;
  display: none;
  overflow: auto;
  padding: 1rem;
  &::-webkit-scrollbar {
    width: 15px;
  }
  &::-webkit-scrollbar-track {
    border-radius: 10px;
    background-color: rgb(121, 121, 134);
  }
  &::-webkit-scrollbar-thumb {
    background-color: rgb(164, 241, 21);
    border: 5px solid rgb(121, 121, 134);
    border-radius: 20px;
  }
  &.active {
    display: flex;
  }
  .item {
    transition: all 0.3s;
    flex: 1 0 10%;
    // padding-top: 7px;
    display: flex;
    align-items: center;
    cursor: pointer;
    color: gray;
    &:hover {
      background-color: antiquewhite;
      border-radius: 10px;
      color: black;
    }
  }
}
.goodsWrapper {
  margin: 20px auto;
  display: flex;
  justify-content: center;
  flex-wrap: wrap;
  gap: 2rem;
  .slot {
    background: rgba(212, 91, 236, 0.3);
    cursor: pointer;
    padding-bottom: 1rem;
    transition: all 0.3s;
    border-radius: 20px;
    &:hover {
      box-shadow: 0 0 10px 2px black;
      animation-name: move-up;
      animation-duration: 0.5s;
      animation-fill-mode: forwards;
      .buttonsWrapper {
        display: flex;
      }
    }
    position: relative;
    height: 400px;
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: space-between;
    .buttonsWrapper {
      position: absolute;
      top: 70%;
      color: white;
      display: flex;
      width: 100%;
      flex-direction: column;
      font-size: 30px;
      align-items: center;
      .row1 {
        width: 50%;
        display: flex;
        align-items: center;
        justify-content: space-around;
      }
      .row2 {
        width: 100%;
        max-width: 160px;
        height: 2rem;
        .addInBasketBtn {
          border-radius: 20px;
          background-color: rgb(189, 35, 146);
          width: 100%;
          height: 100%;
          color: white;
          &:hover {
            transition: all 0.3s;
            background-color: blueviolet;
          }
        }
      }
      .btn {
        transition: all 0.2s;
        width: 40px;
        font-size: 30px;
        border-radius: 50%;
        box-shadow: 0 4px 9px 2px rgb(187, 39, 165);
        &:hover {
          box-shadow: 0 0px 9px 2px rgb(32, 185, 236);
        }
        &:active {
          background: -webkit-linear-gradient(top, #d2ff52 0%, #91e842 100%);
          box-shadow: 0 0px 9px 2px rgb(160, 191, 34);
          color: white;
        }
        &.btnPlus {
          &::before {
            content: "+";
          }
        }
        &.btnMinus {
          &::before {
            content: "−";
          }
        }
      }
      .slot-counter {
        color: black;
      }
    }

    .slot-img {
      border-radius: 20px 20px 0 0;
      max-width: 300px;
      width: 100%;
      height: 70%;
    }
    .description {
      gap: 10px;
      display: flex;
      align-items: center;
      max-width: 300px;
      max-height: 200px;
      justify-content: space-between;
    }
    @keyframes move-up {
      0% {
        top: 0;
      }
      100% {
        top: -1rem;
      }
    }
    .price {
      font-weight: 900;
    }
  }
}
.basket-wrapper {
  width: 100%;
  max-width: 30rem;
  position: fixed;
  top: 0;
  right: -35rem;
  height: 100%;
  z-index: 11;
  background: white;
  border-radius: 10px;
  transition: all 0.4s;
  overflow: auto;
  padding: 1rem;
  &::-webkit-scrollbar {
    width: 15px;
  }
  &::-webkit-scrollbar-track {
    border-radius: 10px;
    background-color: rgb(121, 121, 134);
  }
  &::-webkit-scrollbar-thumb {
    background-color: rgb(164, 241, 21);
    border: 5px solid rgb(121, 121, 134);
    border-radius: 20px;
  }
  .basket-totalPrice {
    font-family: "Shippori Mincho", serif;
    margin-top: 10px;
    font-size: 30px;
  }

  .basketItem {
    background: rgba(212, 91, 236, 0.3);
    margin: 1rem 0;
    position: relative;
    border: 2px solid black;
    border-radius: 10px;
    width: 100%;
    height: 150px;
    padding: 1rem;
    display: flex;
    align-items: center;
    justify-content: space-between;
    &-image {
      border-radius: 25px;
    }
    &-price {
      font-weight: 900;
    }
    .numberChanger {
      width: 33%;
      // max-width: 80px;
      font-size: 25px;
      display: flex;
      justify-content: space-around;
      align-items: center;
      // margin-left: 4rem;
      .basketBtn {
        font-size: 30px;
        transition: all 0.2s;
        width: 40px;
        font-size: 30px;
        border-radius: 50%;
        box-shadow: 0 4px 9px 2px rgb(187, 39, 165);
        &:hover {
          box-shadow: 0 0px 9px 2px rgb(32, 185, 236);
        }
        &:active {
          background: -webkit-linear-gradient(top, #d2ff52 0%, #91e842 100%);
          box-shadow: 0 0px 9px 2px rgb(160, 191, 34);
          color: white;
        }
        &.Plus {
          &::before {
            content: "+";
          }
        }
        &.Minus {
          &::before {
            content: "−";
          }
        }
      }
    }
    .basketItem-delete {
      position: absolute;
      top: -7px;
      right: 5px;
      background-color: transparent;
      &:hover {
        color: red;
      }
      &:before {
        content: "⮾";
        font-size: 30px;
      }
    }
    .description {
      display: flex;
      height: 60px;
      flex-direction: column;
      justify-content: space-between;
      z-index: 20;
      width: 33%;
      text-align: right;
    }
    &-image {
      height: 100%;
      width: 33%;
    }
  }
}

